import { Link } from "react-router-dom";
import "./Components.css";

const Navbar = (props) => {
  return (
    <div>
      <div className="navbar-logo">Best Seller Books</div>
      <div className="navbar-search">
        <form placeholder="Searcg by Title, Author, etc."></form>
      </div>
    </div>
  );
};

export default Navbar;
